import "./Form.css"

import { Link } from "react-router-dom"
import { useState } from "react";
import Validation from './../../components/Validations/Validations'
import { useDispatch } from "react-redux";

import { postPokemon } from "../../redux/actions";

const Form = () => {

    const dispatch = useDispatch();

    const [errors, setErrors] = useState({})

    const [newPokemon, setNewPokemon] = useState({
        nombre: '',
        imagen: '',
        vida: '',
        ataque: '',
        defensa: '',
        velocidad: '',
        altura: '',
        peso: '',
        tipos: "7ca6612a-a2aa-405d-8b8a-91930cdf347e"

    });

    const handleChange = (event) => {

        setNewPokemon({
            ...newPokemon,
            [event.target.name]: event.target.value
        })
        setErrors(Validation({

            ...newPokemon,
            [event.target.name]: event.target.value
        }))
    }
    const handleSubmit = (event) => {
        event.preventDefault();
        dispatch(postPokemon(newPokemon))
    }


    return (
        <>
            <div className="detailCont" >

                <div className="atrascont">
                    <button className=' flechacont'>
                        <Link className='flecha' to='/home'> V </Link>
                    </button>
                    <p>Créa un pokemon !</p>
                    <p>con las características que gustes </p>
                </div>


                <div className="imgtarget">
                    <label className={newPokemon.imagen} htmlFor="imagen">Url de imagen</label>
                    <input onChange={handleChange} type="text" name="imagen" />
                </div>


                <form className="targetimg" onSubmit={handleSubmit}>

                    <div className="target">

                        <label htmlFor="nombre">Nombre</label>
                        <input onChange={handleChange} type="text" name="nombre" />
                        {errors.nombre && <p>{errors.nombre}</p>}

                        <label htmlFor="vida">Vida</label>
                        <input onChange={handleChange} type="text" name="vida" />

                        <label htmlFor="ataque">Ataque</label>
                        <input onChange={handleChange} type="text" name="ataque" />

                        <label htmlFor="defensa">Defensa</label>
                        <input onChange={handleChange} type="text" name="defensa" />

                        <label htmlFor="velocidad">Velocidad</label>
                        <input onChange={handleChange} type="text" name="velocidad" />

                        <label htmlFor="altura">Altura</label>
                        <input onChange={handleChange} type="text" name="altura" />

                        <label htmlFor="peso">Peso</label>
                        <input onChange={handleChange} type="text" name="peso" />

                        <button>Crear</button>

                    </div>
                </form>

            </div>

        </>
    )
}

export default Form;



